    <canvas id="fireworks"></canvas>
    <script>
      var canvas=document.getElementById('fireworks'),ctx=canvas.getContext('2d');
      canvas.width=window.innerWidth;canvas.height=window.innerHeight;
      var fireworks=[];
      function random(min,max){return Math.random()*(max-min)+min;}
      function Firework(x,y){this.x=x;this.y=y;this.s=2;this.a=1;this.color="hsl("+random(0,360)+",100%,50%)";this.velX=random(-5,5);this.velY=random(-5,5);}
      Firework.prototype.update=function(){this.x+=this.velX;this.y+=this.velY;this.a-=0.02;this.s*=0.96;};
      Firework.prototype.draw=function(){ctx.globalAlpha=this.a;ctx.fillStyle=this.color;ctx.beginPath();ctx.arc(this.x,this.y,this.s,0,2*Math.PI);ctx.fill();ctx.globalAlpha=1;};
      function loop(){ctx.clearRect(0,0,canvas.width,canvas.height);if(Math.random()<0.05){for(var i=0;i<100;i++){fireworks.push(new Firework(random(0,canvas.width),random(0,canvas.height/2)));}}for(var i=0;i<fireworks.length;i++){fireworks[i].update();fireworks[i].draw();}fireworks=fireworks.filter(f=>f.a>0);requestAnimationFrame(loop);}
      loop();
    </script>
